import { Button } from '@material-ui/core';
import './App.css';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import { styled } from '@mui/material/styles';
import heroImage from '../src/hero.svg'
import Box from '@material-ui/core/Box';
import serviceImg from '../src/serviceImg.svg';
import me from '../src/me.svg';

function Price() {
  return (
    <Container maxWidth="xl" style={{ background: '#154D43', position: "flex"}}>
     <Grid container spacing = {10} alignContent="flex-start" justifyContent="center">
        <Grid item xs={5} alignItems = "center" justifyContent="center" style={{ paddingTop:"10%"}}>
          {/* <Box p={0}> */}
           <h1 style={{ fontSize: '48', color: "white", fontFamily: 'yeseva one'}}>Services</h1>
          {/* </Box> */}
        </Grid>
        </Grid>
    </Container>
  )
}

export default Price;
